import React from 'react';
import classes from './RestaurantCard.css';
import {
    Card, CardText, CardBody, Button,
    CardTitle, CardSubtitle, Container, Row, Col
} from 'reactstrap';
import StarRatings from 'react-star-ratings';

const restaurantCard = (props) => {

    return (
        <div>
            <Card className={classes.card}>
                <CardBody>
                    <CardTitle tag="h3">Restaurant name</CardTitle>
                    <CardSubtitle tag="h4" className={classes.subtitle}>Address</CardSubtitle>
                    <CardText>
                        <Container>
                            <Row>
                                <Col xs={4} md={3}>Rating: 
                                    <StarRatings
                                        rating={5}
                                        starRatedColor="red"
                                        numberOfStars={5}
                                        starDimension="15px"
                                        starSpacing="3px"
                                    />
                                </Col>
                                <Col xs={3} md={2}>Price rage: </Col>
                            </Row>
                        </Container>
                    </CardText>
                    <Button color="danger">Add to favorite</Button>
                </CardBody>
            </Card>
        </div>
    );
};


export default restaurantCard;
